import React from 'react';
import classes from './navigationItems.module.css';
import NavigationItem from '../NavigationItem/NavigationItem';

const NavigationItems = (props)=>(
    <React.Fragment>
    <ul className={classes.NavigationItems}>
        <NavigationItem link="/cart" exact>Cart</NavigationItem>    
        <NavigationItem link="/" exact>Home</NavigationItem>
        {props.isAuth 
        ?<NavigationItem link="/logout" exact>Logout</NavigationItem> 
        :<NavigationItem link="/login" exact>Login</NavigationItem>
        }
        {props.isAuth 
        ?<NavigationItem link="/" exact>Orders</NavigationItem> 
        :<NavigationItem link="/login" exact>Sign up</NavigationItem>
        }
    </ul>
    </React.Fragment>
);

export default NavigationItems;
